// /screens/word-collection-screen/styles.ts
import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
  },
  button: {
    marginTop: 20,
    backgroundColor: '#4CAF50',
    padding: 10,
    borderRadius: 5,
    alignItems: 'center',  
    justifyContent: 'center', 
  },
  buttonText: {
    color: 'white',  
    fontSize: 16,  
  },
});

export default styles;
